import React, { Component } from "react";
import Header from "./component/Header";
import Blogs from "./component/Blogs";
import Footer from "./component/Footer";

export class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Blogs />
        <Footer />
      </div>
    );
  }
}

export default App;
